import React from 'react'
import { StyleSheet, View } from 'react-native'

const Login = () => {
    return (
        <View style={Styles.box}>
            
        </View>
    )
}

const Styles = StyleSheet.create({
    box: {
        justifyContent:'center',
        alignContent: 'center',
        margin: 200,
        width: '100%',
        height: 50,
        borderStyle: 'solid',
        borderWidth: 5,
        borderColor: '#000',
        borderRadius: 50/100,
        flexWrap: 'wrap-reverse'
    }
})

export default Login
